import React from 'react'
import styled from 'styled-components'

const CountrySelectedStyled = styled.div`

`

function CountrySelected({ flag, name }) {
    return (
        <CountrySelectedStyled>
            <h2>{name}</h2>
            <img src={flag} alt="" />
        </CountrySelectedStyled>
    )
}

export default CountrySelected
